import React, { useState, useEffect } from "react";
import FetchRSIData from "../ComponentsFetch/FetchRSIData";
import FetchStockDataForCode from "../ComponentsFetch/FetchStockDataForCode";
import FetchStockList from "../ComponentsFetch/FetchStockList";
import Highcharts from "highcharts";
import HighchartsReact from "highcharts-react-official";
import HighchartsStock from "highcharts/modules/stock"; // Highcharts Stock 모듈 추가

HighchartsStock(Highcharts);


function ChartOfRSI({ stockCode }) {
    const [stockData, setStockData] = useState([]);
    const [stockList, setStockList] = useState([]);
    const [rsiData, setRsiData] = useState([]);
    const [options, setOptions] = useState({});

    useEffect(() => {
        if (stockList.length > 0 && stockData.length > 0 && rsiData.length > 0) {

            const formattedRSIData = rsiData.map(item => {
                return [
                    new Date(item.date).getTime(),
                    item.RSI
                ];
            });

            const formattedClosePriceData = stockData.map(item => ({
                x: new Date(item.date).getTime(),
                y: item.close
            }));

            const formattedVolumeData = stockData.map(item => ({
                x: new Date(item.date).getTime(),
                y: item.volume,
            }));


            setOptions({
                chart: {
                    height: 600,
                    spacing: [10, -70, 10, 10],
                    zoomType: 'x',
                    events: {
                        render: function () {
                            // Close Price 텍스트의 위치 강제 조정
                            this.yAxis[0].axisTitle.attr({
                                x: this.plotLeft +40,
                                y: this.plotTop +20
                            });

                            // MFI 텍스트의 위치 강제 조정
                            this.yAxis[1].axisTitle.attr({
                                x: this.plotLeft + 30,
                                y: this.plotTop + (this.plotHeight * 0.55) + 7
                            });

                            // Volume 텍스트의 위치 강제 조정
                            this.yAxis[2].axisTitle.attr({
                                x: this.plotLeft + 38,
                                y: this.plotTop + (this.plotHeight * 0.85) -40
                            });
                        }
                    }
                },
                title: {
                    text: ''
                },
                accessibility: {
                    enabled: false
                },
                xAxis: {
                    type: 'datetime',
                    crosshair: true,
                },
                yAxis: [
                    {
                        title: {
                            text: 'Close Price',
                            style: {
                                fontSize: '12px',
                            },
                            rotation: 0,
                        },
                        height: '50%',
                        lineWidth:2,
                        opposite: true,
                    },
                    {
                        title: {
                            text: 'Volume',
                            style: {
                                fontSize: '12px',
                            },
                            rotation: 0,
                        },
                        top: '52%',
                        height: '18%',
                        offset: 0,
                        lineWidth: 2,
                        labels: {
                            enabled: false // 볼륨에 라벨 비활성화
                        },
                        opposite: true,

                    },
                    {
                        title: {
                            text: 'RSI(30, 70)',
                            style: {
                                fontSize: '11px',
                            },
                            rotation: 0,
                        },
                        top: '72%',
                        height: '28%',
                        offset:0,
                        lineWidth:2,
                        min: 0,
                        max: 100,
                        tickPositions: [5, 30, 70, 95],
                        plotBands: [{
                           from: 30,
                           to: 70,
                           color: 'rgba(221, 160, 221, 0.2)'
                        }],
                        labels:{
                            formatter: function() {
                                if(this.value === 5 || this.value === 95) {
                                    return '';
                                }
                                return this.value;
                            }
                        },
                        plotLines: [
                            {
                                value: 70,
                                color: 'gray',
                                dashStyle: 'dash',
                                width: 1,
                                zIndex: 5,
                            },
                            {
                                value: 30,
                                color: 'gray',
                                dashStyle: 'dash',
                                width: 1,
                                zIndex: 5,
                            }
                        ],
                        opposite: true,
                    }
                ],
                series: [
                    {
                        name: 'Close Price',
                            type: 'line',
                            data: formattedClosePriceData, // Close Price 데이터
                            marker: {
                                enabled: false,
                            },
                            yAxis: 0, // 첫 번째 yAxis (Close Price)
                            color: '#0071e3', // Close Price 라인 색상
                            lineWidth: 1.5,
                    },
                    {
                        name: 'Volume',
                        type: 'column',
                        data: formattedVolumeData,
                        yAxis: 1,
                        color: '#A9A9A9', // Volume 컬럼 색상
                        pointWidth: 2,
                    },
                    {
                        name: 'RSI',
                        type: 'line',
                        data: formattedRSIData,
                        marker: {
                            enabled: false,
                        },
                        yAxis: 2,
                        color: '#8E44AD',
                        lineWidth: 1.5,
                    }
                ],
                legend: {
                    enabled: false // 범례 숨기기
                },
                credits: {
                    enabled: false // "Highcharts.com" 표시 비활성화
                },
                tooltip: {
                    shared: true,
                    crosshairs: true,
                    formatter: function () {
                        let tooltipHtml = `<b>${Highcharts.dateFormat('%m-%d', this.x)}</b><br/>`;
                        this.points.forEach(point => {
                            tooltipHtml += `${point.series.name}: <b>${point.y.toFixed(2)}</b><br/>`;
                        });
                        return tooltipHtml;
                    }
                },
                rangeSelector: {
                    enabled: true, // 범위 선택 옵션 활성화
                    inputEnabled: false,
                    buttons: [
                        {
                            type: 'month',
                            count: 1,
                            text: '1m'
                        },
                        {
                            type: 'month',
                            count: 3,
                            text: '3m'
                        },
                        {
                            type: 'month',
                            count: 6,
                            text: '6m'
                        },
                        {
                            type: 'ytd',
                            text: 'YTD'
                        },
                        {
                            type: 'year',
                            count: 1,
                            text: '1y'
                        },
                        {
                            type: 'all',
                            text: 'All'
                        }
                    ],
                    selected: 5 // Default 선택 범위 설정 (3개월)
                },
                scrollbar: {
                    enabled: true, // 하단 스크롤바 활성화
                }
            });
        }
    }, [stockList, stockData, rsiData, stockCode]);

    return (
        <div>
            <FetchStockDataForCode stockCode={stockCode} onSDFCFetch={setStockData} />
            <FetchStockList onListFetch={setStockList} />
            <FetchRSIData stockCode={stockCode} onRSIFetch={setRsiData} />

            {options.series && options.series.length > 0 && (
                <HighchartsReact highcharts={Highcharts} options={options} />
            )}
        </div>
    );
}

export default ChartOfRSI;
